        this.kafkaTemplate = kafkaTemplate;
        log.info("CommonController initialized {}", Constant.Regex.EMAIL);
        this.commonService = commonService;
    }

    @GetMapping("/persons")
    public BaseResponse<List<Person>> getPersons(String topicName) {
        String topic = "demo-topic";
